import React from 'react';
import {Container, ImageOne, TextTitle, BoxImage, ProgressBar} from './style.js';
import brainwave from '../../assets/brainwave.svg';
import illustrationfr from '../../assets/illustrationfr.svg';
import globe from '../../assets/globe.svg';
import toprightBackground from '../../assets/toprightBackground.png';

function LandingPage() {
  return (
    <Container>
      <ImageOne>
        <img src={brainwave} alt="brainwave"/>
      </ImageOne>
      <TextTitle>
        <span className="textshadow">What We Do</span>
        <div/>
      </TextTitle>
      <BoxImage>
        <img src={illustrationfr} alt="illustrationfr"/>
        <span>1</span>
      </BoxImage>
      <ProgressBar>
        <div className="ProgressBarActive"/>
      </ProgressBar>
    </Container>
  );
}

export default LandingPage;
